import  { FC } from 'React';
import styled from 'styled-components';
import { Wrapper } from '../../styledHelpers/Components';
import { Colors } from '../../styledHelpers/colors'
import useDropdown from 'react-dropdown-hook';
import Link from '../Link'

const InnerWrapper = styled.div`
width:100%;
background: ${Colors.white};
`;

const RightIcons = styled.div`
float: right;
text-align: 10px;
display:flex;
`;
const LeftIcons = styled.div`
float: left;
margin-top: auto;
`;
const SearchBar = styled.div`
text-align: center;

`;
const Home = styled.label`
padding-right:200px;
float:left;
`;

const InputWrapper = styled.div`
display:flex;
justify-content: space-between;
align-items:center;
margin-top:5px;
margin-bottom:5px;

`;
const Logo= styled.img`
width:10%;
height:30px;
margin-left:10px;
margin-right:10px;
`;
const HomeIcon = styled.img`
margin-bottom:4px;
`;
const HouseIcon = styled.img`
margin-right:10px;
`;

const CommentsIcon = styled.img`
margin-right:10px;
`;
const BellIcon = styled.img`
margin-right:10px;
`;


export const TopBar: FC = () => {
    return (
        <Wrapper>
            <InnerWrapper>

                <InputWrapper>
                <LeftIcons>
                <Logo src="./media/icons/logo.png"/> 
                <HomeIcon src="./media/icons/house2.png" />
                </LeftIcons>
                <Home>HOME</Home>
                <SearchBar>
                     <div>
                        <input type="szukaj" placeholder="Hello there" style={{width: "370px"}} ></input>
                         <img src ="./media/icons/search.png"  alt="" ></img>
                    </div>
                </SearchBar>
                <RightIcons>
                    <HouseIcon src="./media/icons/house.png" alt=""/>
                    <CommentsIcon src="./media/icons/comments.png" alt="" />
                    <BellIcon src="./media/icons/bell.png" alt=""/>
                </RightIcons>
                </InputWrapper>
            </InnerWrapper>
        </Wrapper>
    );
};
